  static bool
  create_schema (database& db, unsigned short pass, bool drop)
  {
    ODB_POTENTIALLY_UNUSED (db);
    ODB_POTENTIALLY_UNUSED (pass);
    ODB_POTENTIALLY_UNUSED (drop);

    if (drop)
    {
      switch (pass)
      {
        case 1:
        {
          return true;
        }
        case 2:
        {
          db.execute ("BEGIN\n"
                      "  BEGIN\n"
                      "    EXECUTE IMMEDIATE 'DROP TABLE \"PHIEUNHAPKHO\" CASCADE CONSTRAINTS';\n"
                      "  EXCEPTION\n"
                      "    WHEN OTHERS THEN\n"
                      "      IF SQLCODE != -942 THEN RAISE; END IF;\n"
                      "  END;\n"
                      "  BEGIN\n"
                      "    EXECUTE IMMEDIATE 'DROP SEQUENCE \"PHIEUNHAPKHO_FCSEQ\"';\n"
                      "  EXCEPTION\n"
                      "    WHEN OTHERS THEN\n"
                      "      IF SQLCODE != -2289 THEN RAISE; END IF;\n"
                      "  END;\n"
                      "END;");
          return false;
        }
      }
    }
    else
    {
      switch (pass)
      {
        case 1:
        {
          db.execute ("CREATE TABLE \"PHIEUNHAPKHO\" (\n"
                      "  \"PHIEUNHAPKHOID\" NUMBER(20) NOT NULL PRIMARY KEY,\n"
                      "  \"KHOID\" NUMBER(20) NOT NULL,\n"
                      "  \"DANHMUCCOQUANTYPEID\" NUMBER(20) NOT NULL,\n"
                      "  \"SOPHIEU\" NVARCHAR2(50) NULL,\n"
                      "  \"TENNGUOIGIAO\" NVARCHAR2(50) NULL,\n"
                      "  \"NGAYNHAPKHO\" DATE NULL,\n"
                      "  \"GHICHU\" NVARCHAR2(255) NULL,\n"
                      "  \"NGUOISUAID\" NUMBER(20) NOT NULL,\n"
                      "  \"NGAYCHINHSUA\" DATE NULL,\n"
                      "  \"TRANGTHAI\" NUMBER(1) NOT NULL)");
          db.execute ("CREATE SEQUENCE \"PHIEUNHAPKHO_FCSEQ\"\n"
                      "  START WITH 1 INCREMENT BY 1");
          return false;
        }
      }
    }

    return false;
  }

